IF OBJECT_ID('dbo.proc_transform_243', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_243;
GO
CREATE PROCEDURE dbo.proc_transform_243
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_243
    SET payload = LEFT(payload, 1000) + N'|V4-243|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_243;
END
